import gql from "graphql-tag";

const PRODUCTS_NEW = gql`query  Product_new($id: ID!){
    products(first: 4) {
        nodes {
          id
          description
          name
           slug
          image {
            id
            sourceUrl
            slug
          }
        }
      }
    }`;
    export default PRODUCTS_NEW;
